// Home.js
import React from "react";
import { Link } from "react-router-dom";
import "./Home.css"; // Import CSS file for styling

const Home = () => {
    return ( 
        <div className="Home">
            <div className="Left animated">
                <h1>BEAUTYPLEX</h1>
                <h2>Bienvenue dans notre boutique de produits cosmétiques, où chaque produit est soigneusement sélectionné pour vous offrir une expérience de beauté incomparable<span className="typing-animation"></span></h2>
                <h3>Découvrez une sélection soigneusement choisie pour sublimer votre beauté naturelle.</h3>
                <Link to={"/products"} id="hh" ><a id="ExploreProduct" >Explorer les produits</a></Link>   
            </div>
            <div className="Right">
                <img id ="product" src="./bioplex.png" alt="bioplex"/> 
            </div>
        </div>
     );
}
 
export default Home;
